description:
The closest you can get to seeing the USMLE Step 2 CK without actually taking it

Family Medicine: PreTest Self-Assessment &amp; Review is the perfect way to assess your knowledge of Family Medicine for the USMLE Step 2 CK and shelf exams. You'll find 500 USMLE-style questions and answers that address the clerkship's core competencies along with detailed explanations of both correct and incorrect answers. All questions have been reviewed by students who recently passed the boards and completed their clerkship to ensure they match the style and difficulty level of the exam.

